import josn from '@htmlplus/core/dist/docs.json';

const isDev = process.env.NODE_ENV === 'development';

// @ts-ignore
export const components = josn.components.filter((component) => !component.development || isDev);

// TODO:
isDev && process.browser && console.log(components);
